from collections import Counter
import copy,json,os
import numpy as np

class recommed_recall_test:
    def __init__(self,data=str,recall_type=int):
        '''

        :param data:
        :param recall_type: 1代表是items:score,2代表是items:时间戳。
        '''
        self.recall_original_data = data
        self.recall_type = recall_type
        self.recall_items = []
        self.recall_style_id = []
        self.recall_score = []
        self.recall_timestamp = []
        self.check_reacll_data_format()
        # self.check_recall_data_standard()
        self.check_recall_items_repeat()
        # self.check_score_repeat()
        # self.check_score_rank()
        # self.check_score_scope()

    def check_reacll_data_format(self):
        '''
        召回集格式检验，key:valu，一种是items:score，一种是items:时间戳。
        :return:
        '''
        print("-----开始校验recall数据格式是否存在异常-----")
        tag = True
        try:
            self.recall_items = [x.split(":")[0] for x in [i for i in self.recall_original_data.split(",")]]
            if self.recall_type == 1:
                self.recall_score = [x.split(":")[1] for x in [i for i in self.recall_original_data.split(",")]]
                self.recall_style_id = [x.split(":")[2] for x in [i for i in self.recall_original_data.split(",")]]
            elif self.recall_type == 2:
                self.recall_timestamp = [x.split(":")[1] for x in [i for i in self.recall_original_data.split(",")]]
            else:
                pass

        except:
            tag = False
            print("recall数据格式存在异常")

        if self.recall_original_data.count(",")+1 == self.recall_original_data.count(":"):
            pass
        else:
            tag = False
            print("recall数据:号和,号数量不一致，存在异常")

        if tag ==True:
            print("校验结果正确，recall数据格式无异常")

        print()

    def check_recall_data_standard(self):
        print("-----开始校验recall数据是否符合规范-----")
        tag = True

        for i in self.recall_items:
            if i.isdigit(): #判断items数据是否数字
                pass
            else:
                tag = False
                print("recall items数据 {}，不符合规范".format(i))

        if len(self.recall_score) > 0:
            for i in self.recall_score:
                try:
                    i = float(i)
                    if i != i: #判断socre是否存在NaN
                        tag = False
                        print("recall score数据 {}，不符合规范".format(i))
                    else:
                        pass
                except: #判断socre数据是否数字
                    tag = False
                    print("recall score数据 {}，不符合规范".format(i))

        if len(self.recall_timestamp) > 0:
            for i in self.recall_items:
                if i.isdigit(): #判断时间戳数据是否数字
                    pass
                else:
                    tag = False
                    print("recall timestamp数据 {}，不符合规范".format(i))

        if tag ==True:
            print("校验结果正确，数据符合规范")

        print()

    def check_score_rank(self):
        print("-----开始校验recall score排序是否是降序-----")
        tag = True
        if sorted(self.recall_score,reverse=True) == self.recall_score:
            pass
        else:
            tag = False
            print("recall score排序不是降序 {}".format(self.recall_score))

        if tag ==True:
            print("校验结果正确，recall score排序是降序")

        print()

    def check_score_scope(self):
        print("-----开始校验recall score是否在归一化区间-----")
        tag = True

        for i in self.recall_score:
            if float(i) > 0 and float(i) <= 1:
                pass
            else:
                tag = False
                print("recall score不在归一化区间 {}".format(float(i)))

        if tag ==True:
            print("校验结果正确，score在归一化区间")

        print()

    def check_recall_items_repeat(self):
        '''
        召回集格式检验
        :return:
        '''
        print("-----开始校验recall items是否存在重复-----")
        repeat_items = {key:value for key,value in dict(Counter(self.recall_items)).items() if value > 1} #获取重复items
        if len(repeat_items) == 0:
            print("校验结果正确，recall items不存在重复数据")
        else:
            print("recall items重复数据是 {}".format({key:value for key,value in dict(Counter(self.recall_items)).items() if value > 1}))
            print("redis召回集的集合数量 {}".format(len(repeat_items)))
            print("redis召回集的集合id {}".format(repeat_items.keys()))
            print(self.recall_style_id)
            result_dict = {str(x):[] for x in repeat_items.keys()}
            aa = [x.split(":") for x in [i for i in self.recall_original_data.split(",")]]
            collection_dict = {"collectionId":"","goodsId":"","styleId":"","score":""}
            collection_list = []
            result = []
            score = self.tapd_test()
            # print(score)

            for i in repeat_items.keys():
                for j in aa:
                    if int(j[0]) == int(i):
                        collection_dict["collectionId"]= j[0]
                        collection_dict["goodsId"]= j[1]
                        collection_dict["styleId"]= j[2]
                        collection_dict["score"]= score[j[2]]
                        collection_list.append(copy.deepcopy(collection_dict))

                copy_list = copy.deepcopy(collection_list)
                result.append(sorted(copy_list,key=lambda i:i["score"],reverse=True))
                collection_list.clear()

            print(os.path.join(os.path.abspath(os.getcwd()),"log_result.json"))

            with open(os.path.join(os.path.abspath(os.getcwd()),"log_result.json"),"w") as f:
                f.write(json.dumps(result))

            # rank_result = {}
            # for k,v in result_dict.items():
            #     rank_result[k] = self.avg(v)
            #
            # print(sorted(rank_result.items(),key=lambda kv:(kv[1],kv[0]),reverse=True))

        print()

